import React from 'react'

import ''
const navBarData = [
	{
		"type": "Stays",
		"icon": "fa-bed",
		"title": "Stays",
		"active": true
	},
	{
		"type": "Flights",
		"icon": "fa-plane",
		"title": "Flights",
		"active": false
	},
	{
		"type": "Car rentals",
		"icon": "fa-car",
		"title": "Car rentals",
		"active": false
	},
	{
		"type": "Attractions",
		"icon": "fa-bed",
		"title": "Attractions",
		"active": false
	},
	{
		"type": "Airport taxis",
		"icon": "fa-taxi",
		"title": "Airport taxis",
		"active": false
	}
]

function NavBar() {

	return (
		<div>
			<div>
				Booking Website
			</div>
			<button>Register</button>
			<button>Login</button>
			<ul>
				{navBarData.map((item, i) => (
					<li key={i}>
            <i className={`fa ${item['icon']}`}></i>
						{item['title']}
					</li>
				))}
			</ul>
		</div>
	)
}

export default NavBar
